import logo from './logo.svg';
import './App.css';
import { Component } from 'react';
import {
  BrowserRouter as Router,Routes,Route,Link} from "react-router-dom";
import Login from './routes/login';
import Signup from "./routes/signup"
import EmailConfirm from './routes/emailconfirm';
import Alltask from './adminroutes/alltask';
const ip = "http://192.168.43.196:5555"

class App extends Component {

  render() {
    return (
      <div>
        <Router>
          <Routes>
            <Route path="/login"  element={<Login ip={ip}/>}></Route>
            <Route path="/signup"  element={<Signup/>}></Route>
            <Route path="/email-confirm"  element={<EmailConfirm/>}></Route>

            {/* Admin Routes */}
            <Route path="/admin/alltask" element={<Alltask/>}></Route>
          </Routes>
        </Router>
      </div>
    )
  }
}

export default App;
